import React from 'react';
import Slider from "react-slick";
import styles from "./home.modules.css";
import img1 from "../../assets/fp1.jpeg";
import img2 from "../../assets/fp2.jpeg";
import img3 from "../../assets/fp3.jpeg";

export default function Home() {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    className: "slider",
    arrows: true,
    prevArrow: <PrevArrow />,
    nextArrow: <NextArrow />
  };

  function PrevArrow(props) {
    const { className, Styles, onClick } = props;
    return (
      <div className={`${className} ${styles.arrow}`} onClick={onClick}>
        <i className="fas fa-chevron-left"></i>
      </div>
    );
  }

  function NextArrow(props) {
    const { className, style, onClick } = props;
    return (
      <div className={`${className} ${styles.arrow}`} onClick={onClick}>
        <i className="fas fa-chevron-right"></i>
      </div>
    );
  }

  return (
    <Slider {...settings}>
      <div className={styles.slide}>
        <div className={styles.card}>
          <img src={img1} alt="img1" className={styles.img}/>
          <div className={styles.text}>
            <h3>Image 1</h3>
            <p>Description of image 1 goes here.</p>
          </div>
        </div>
      </div>
      <div className={styles.slide}>
        <div className={styles.card}>
          <img src={img2} alt="img2" className={styles.img}/>
          <div className={styles.text}>
            <h3>Image 2</h3>
            <p>Description of image 2 goes here.</p>
          </div>
        </div>
      </div>
      <div className={styles.slide}>
        <div className={styles.card}>
          <img src={img3} alt="img3" className={styles.img}/>
          <div className={styles.text}>
            <h3>Image 3</h3>
            <p>Description of image 3 goes here.</p>
          </div>
        </div>
      </div>
    </Slider>
  );
}
